// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../../../abstract/Ownable.sol";

import {DATABASE_KEY} from "../../../constant/SecretKey.sol";

import {Apply} from "../../../struct/business/apply/ApplyStruct.sol";

contract ListApply is Ownable {
    mapping(uint256 => Apply) private list;
    uint256 private autoIncrement = 0;

    constructor() Ownable() {}

    event Add(Apply item);

    event Remove(Apply item);

    modifier requestSecretkey(bytes32 value) {
        require(value == DATABASE_KEY, "Database ListApply: Secret key error");
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListApply: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(Apply memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (uint256)
    {
        autoIncrement++;
        item.applyId = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return autoIncrement;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (Apply memory)
    {
        return list[index];
    }

    function hide(uint256 index, bytes32 secret)
        public
        requestSecretkey(secret)
        validIndex(index)
        returns (bool)
    {
        Apply memory gap = Apply(0, 0, 0, 0, 0, 0);
        list[index] = gap;
        return true;
    }
}

